import React from 'react';
import './App.css';
import {Route , Switch }from 'react-router-dom';

import HomePage from './pages/homepage/homepage.compoent';
// some demo
import RouteDemo from './someDemo/router.component';


const HatsPage =()=><div>Hatpages</div>

const Demo2Page =()=><div>Demo2Page</div>

function App() {
  return (
    <div>   

    <Route  path='/hats' component={HatsPage}/>
    <Route  path='/demopage' component={Demo2Page}/>
    <Route  path='/blog/demopage/:id' component={Demo2Page}/>
    <Route exact  path='/' component={HomePage}/>
    <Route   path='/demo/:id/:name' component={RouteDemo}/>


    </div>

  );
}

export default App;
